<!doctype html>
<html lang="en">
<head>
	<meta charset="UTF-8">
	<title>freeSVG</title>
	<style>
	html{-webkit-text-size-adjust:100%;-ms-text-size-adjust:100%;-webkit-appearance:none;font-size:100%}
	body,div,ul li,ol,h1,p{margin:0;padding:0}
	ul{list-style:none}
	body{background-color:#eee;}
	.clearfix:before,.clearfix:after{content:"";display:table}
	.clearfix:after{clear:both}
	.clearfix{*zoom:1}
	code{white-space:nowrap;border:1px solid #CCC;padding:2px 4px;border-radius:2px;font-size:12px;margin:0 2px;}
	pre{display:block;padding:14px;line-height:18px;font-size:14px;border:1px solid #D9D9D9;white-space:pre-wrap;word-wrap:break-word;border-radius:3px;color:#FFF;}
	.wrap{margin:0 auto;width:100%;max-width:1000px;max-width:62.5rem;background-color:#fff;_width:1000px}
	#header{background-color:#47C2DC;position:relative;border-top:8px solid #4682B4;text-align:center;padding:20px;color:#FFF;}
	#header h1{font-size:32px;padding:10px;}
	#header p{font-size:12px;}
	#svgs{padding:6px;}
	#svgs li{display:inline-block;padding:12px;}
	.icon{width:42px;height:42px;fill:#666;cursor:pointer;}
	.icon:hover{fill:#4682B4;}
	.bigicon .icon{width:150px;height:150px;fill:#fff;cursor:pointer;}
	#intro{background-color:#47C2DC;padding:25px;}
	#intro .wrap{padding-left:150px;}
	.bigicon,.codes{float:left;background-color:#47C2DC;}
	.bigicon{width:30%;}
	.codes{width:70%;}
	.codes textarea{margin: 2px 0;color: #333 !important;resize: none;display: inline-block;text-decoration: none;color: #BBB;border: 1px solid #EEE;padding: 8px 10px;border-radius: 2px;transition: all 0.2s ease-in-out 0s;font-family: "Microsoft Yahei",arial,helvetica,sans-serif;}
	</style>
	<script src="http://cdn.bootcss.com/jquery/2.1.1/jquery.min.js"></script>
	<script>
	$(document).ready(function(){
		$("#svgs li").click(function(){
			d = $(this).html();
			$(".bigicon").html(d);
			$(".codes").find("textarea").html(d);
			$('body,html').animate({scrollTop:0},500);
		});
	});
	</script>
</head>
